if(document.getElementById("redirecturl-list")){if(document.getElementById("delete_dialog_form")){const a=document.getElementById("redirecturl-list").getElementsByClassName("btn-danger");Array.from(a).forEach(a=>{a.addEventListener("click",a=>{document.getElementById("delete_dialog_form").querySelector("input[name=\"theliaredirecturl_id\"]").value=a.currentTarget.dataset.id})})}if(document.getElementById("update_dialog_form")){const a=document.getElementById("redirecturl-list").getElementsByClassName("btn-info");Array.from(a).forEach(a=>{a.addEventListener("click",a=>{const b=a.currentTarget.parentElement.parentElement.parentElement.children;document.getElementById("update_dialog_form").querySelector("input[name=\"redirect_url_update[id]\"]").value=b[0].innerText,document.getElementById("redirect-update-url").value=b[1].innerText,document.getElementById("redirect-update-temp_redirect").value=b[2].innerText,document.getElementById("redirect-update-redirect").value=b[3].innerText})})}}
